import React from 'react';
import './Box.css'
const Box = ({user,result,item}) => {

  return (
    <div className={result ==='userWin'?'win':(result ==='computerWin'?'lose':'Box')}>
      <h1>{user}</h1>
      <img className='Box_img' src={item?.img}/>
      <h2>{result}</h2>
    </div>
  );
}

export default Box;
